import React from 'react'
import Axios from 'axios'

const DisplayTeachers = (props) => {
    let name= props.str;
    let names= [];
    Axios.get("http://localhost:3001/search",{params: { name : name}}).then((response)=>{
        names.push(response.data); 
    });
    if(names===undefined) return <div></div>;
    console.log(names);
    let array= names.map(name=>{
        let dbdata;
        Axios.get("http://localhost:3001/profile",{params: { name : name}}).then((response)=>{
            dbdata= response.data; 
        });
        return (
        <div>
            <div>
                {name},{dbdata.date},{dbdata.starttime},{dbdata.endtime},{dbdata.task}
            </div>
            <button>
                Add
            </button>
        </div>
        );
    });
    console.log(array);
    return (
        <div>
        {
           names.map(name=>{
            let dbdata;
            Axios.get("http://localhost:3001/profile",{
                params: { name : name}
            }).then((response)=>{
                dbdata = response.data; 
                console.log(dbdata);
            });
            return (
            <div>
                <div>
                    {name},{dbdata.date},{dbdata.starttime},{dbdata.endtime},{dbdata.task}
                </div>
                <button>
                    Add
                </button>
            </div>
            );
            })
        }
        </div>
    )
}

export default DisplayTeachers
